    }

    render()
    {
        return(

            <div className="App" >
            <header>Upload Uour Garden Pictures Here</header>
            <input type= "file" onChange={this.fileSelectedHandler} />
            <button>Upload</button>
            </div>

        )
    }
}

export default GardenPhotos;
